,\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"445421","type":"CustomJS"},{"attributes":{},"id":"445592","type":"StringFormatter"},{"attributes":{"data":{"Close":{"__ndarray__":"AAAA4ENexUAAAACgJ8jDQAAAAMD1VMVAAAAAgPT2xEAAAABAKo3EQAAAAODxZ8RAAAAAgP2MxEAAAADAjOfFQAAAAMB1zcRAAAAA4JFtxUAAAADAPlfEQAAAAMD+EcVAAAAAIK5DxUAAAADgo3/EQAAAAOBjS8NAAAAAIHz3xEAAAABg+E/FQAAAAEAzg8RAAAAAoGeNxEAAAAAA4G7DQAAAAKDHR8FAAAAA4JG5wUAAAACgxz3DQAAAAADJksNAAAAAAABgw0AAAACgEL3DQAAAAGD4UcRAAAAAIBxtw0AAAAAAoGLDQAAAAEChDcJAAAAAgEsQwUAAAAAAwOvAQAAAACDup71AAAAA4INmwEAAAACAC2DBQAAAAKDQSsBAAAAAYM91v0AAAACAFNO+QAAAAEAhOL9AAAAAgAuQwEAAAABAIUnBQAAAAGC4jMFAAAAAYOYIwkAAAAAA6WPCQAAAAKCHHcJAAAAAYI8kw0AAAADgOhvDQAAAAMD1asRAAAAAAAl8xEAAAADA9avEQAAAAKDZOsRAAAAAAMn4w0AAAACgOebDQAAAAIC9YcRAAAAA4NrNw0AAAADA9d7DQAAAAIAisMNAAAAAILyVw0AAAACAAl7EQAAAAECBD8VAAAAAYPh8xEAAAACAHQfFQAAAAEDhg8RAAAAAQEHow0AAAACAvXHEQAAAACB8EcRAAAAAgHTIxEAAAADAzHjEQAAAAKBZpMRAAAAAAAlkxEAAAABg7xrFQAAAAADA7sRAAAAAIG44xUAAAACAtHjFQAAAAACpssVAAAAA4JEzxkAAAACgJ9DFQAAAACAcx8VAAAAAANfYxUAAAABAkzrGQAAAAACJz8ZAAAAAgF2Yx0AAAAAA997HQAAAAECTV8hAAAAAYNimyEAAAACgUPbHQAAAAMAsIchAAAAAgHSDyUAAAADg0Z3KQAAAAGBPMMpAAAAAwP7NyUAAAADA3hbKQAAAAKDQI8tAAAAAQAE1y0AAAAAg3B3KQAAAAABp6MlAAAAAIC61yEAAAADgMfXHQAAAAOBx88dAAAAAoBAKyUAAAAAAKa/IQAAAAEABK8ZAAAAAgAI5xkAAAADg+ovGQAAAAIBUMcVAAAAAQIE2wkAAAAAghT7BQAAAAOAxJMFAAAAAINxAv0AAAAAg7pa7QAAAAIDruL1AAAAAwB7ov0AAAABAKprAQAAAAACAf8BAAAAAIM7pwUAAAADgI4zCQAAAAOAj+MJAAAAAgF34wkAAAACAazTEQAAAAGAGXsRAAAAAQKqpw0AAAABAoSrEQAAAAKBQNMVAAAAAIE6AxUAAAACgUMzDQAAAAIACF8NAAAAAYPhwxEAAAAAgXI/DQAAAAGAGEsVAAAAAwD63xUAAAACAAn/FQA
